import React, { useState } from "react";
import { useNavigate } from 'react-router-dom';

const Login = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();
    
    const handlelogin = () => {
        if (username === 'tranlamnhu' && password === 'khung') {
            navigate('/home');
        }
        else{
            alert('Đăng nhập không thành công!. Kiểm tra lại cái coi đcm');
        }
    };

    return (
        <div class="container mt-5 pt-5">
            <div class="row">
                <div class="col-12 col-sm-8 col-md-6 m-auto">
                <h2>Đăng nhập</h2>
                    <form>
                        <div class="mb-3 mt-3">
                            <label for="username">Tên đăng nhập:</label>
                            <input class="form-control" type="text" id="username" name="username" value={username} onChange={(e) => setUsername(e.target.value )} />
                        </div>
                        <div class="mb-3">
                            <label>Mật khẩu:</label>
                            <input class ="form-control" type="password" id="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} />
                        </div>
                        <button type="submit" class="btn btn-primary" onClick={handlelogin}>Đăng nhập</button>
                    </form>
                </div>
            </div>
        </div>
    )
}

export default Login;
